import  Container  from "react-bootstrap/Container";

import Main from "../../components/Navi/main";
function Home() {
  return (
    <Container fluid>
      <div className='row justify-content-center'>
      
      <Main />
      </div>
    
    </Container>
  );
}
export default Home;
